			["displayText"] = "%c",
			["customText"] = "-- @Author: Nianah-Shattered-Hand, EU - taccr#2738\nfunction()\n    local debuff = \"Touch of Harm\"\n    local unitId, numPlayers, value\n    local ret = \"\"\n    \n    numPlayers = GetNumGroupMembers()\n    if numPlayers == 0 or not IsInRaid() then return nil end\n    \n    -- Shorten number\n    local shortenNumber = function(value)\n        if value >= 1000000 then\n            value = math.floor(value/1000000) .. \"m\"\n        elseif value >= 1000 then\n            value = math.floor(value/1000) .. \"k\"\n        end\n        return value\n    end\n    \n    -- Number coloring\n    local colorNumber = function(value, maxValue)\n        if value >= 2 * maxValue / 3 then\n            return \"|cFFFF0000\" .. shortenNumber(value) .. \"|r\"           \n        elseif value >= maxValue / 3 then\n            return \"|cFFFFFF00\" .. shortenNumber(value) .. \"|r\"\n        else\n            return \"|cFF00FF00\" .. shortenNumber(value) .. \"|r\"\n        end\n    end\n    \n    -- Name coloring\n    local setClassColor = function(unitId) \n        _,class = UnitClass(unitId) \n        local color = RAID_CLASS_COLORS[class].colorStr\n        return  \"|c\" .. color .. UnitName(unitId) .. \"|r\"\n    end\n    \n    \n    -- Main\n    for i = 1, numPlayers do\n        unitId = \"raid\"..i\n        if UnitDebuff(unitId, debuff) then\n            value = select(15, UnitDebuff(unitId, debuff)) or 0\n            if not aura_env[\"maxValue\"] then\n                aura_env[\"maxValue\"] = value\n            end\n            \n            ret = ret .. setClassColor(unitId) .. \": \" .. colorNumber(value, aura_env[\"maxValue\"]) .. \"\\n\"\n        end\n    end\n    \n    return ret\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
