				["init"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.pGUID = UnitGUID(\"player\");\n\naura_env.Init = function()\n    aura_env.counter = 0;\nend\n\naura_env.GetExplosionMultiplier = function()\n    for i=11,12 do\n        local name, _, _, iLevel = GetItemInfo(GetInventoryItemLink(\"player\", i));\n        if name == \"Maalus, the Blood Drinker\" then\n            aura_env.equipped = true;\n            aura_env.multiplier = 0.25 * 1.15^((iLevel-735)/15);\n            return;\n        end\n    end\n    aura_env.equipped = false;\nend\n\naura_env.GetExplosionMultiplier();\naura_env.Init();",
