				["spellIds"] = {
				},
				["customName"] = "function()\n    if aura_env.counter and aura_env.multiplier then\n        local v = aura_env.counter * aura_env.multiplier\n        if v < 1e6 then\n            return string.format(\"%dk\", v/1e3);\n        else\n            return string.format(\"%.2fm\", v/1e6)\n        end\n    end\n    return \"0\";\nend",
				["custom"] = "function(e, _, event, _, src, _, sourceFlags, _, _, _, _, _, ...)\n    if e == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local myPet = sourceFlags and bit.band(sourceFlags, COMBATLOG_OBJECT_AFFILIATION_MASK) == 1\n        if aura_env.equipped and (src == aura_env.pGUID or myPet) then -- Player or Players Pet Damage\n            if event == \"SPELL_DAMAGE\" or event == \"RANGE_DAMAGE\" or event == \"SPELL_PERIODIC_DAMAGE\"  then\n                local amount;\n                amount = select(4,...);\n                aura_env.counter = aura_env.counter + amount;\n            elseif event == \"SWING_DAMAGE\" then\n                local amount;\n                amount = select(1,...);\n                aura_env.counter = aura_env.counter + amount;\n            end   \n        elseif event == \"SPELL_AURA_REMOVED\" and ... == 187620 then -- Ring Buff SpellID\n            -- boom\n            aura_env.Init();\n        end\n        \n    else\n        aura_env.GetExplosionMultiplier();\n    end\n    \n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
