				["duration"] = "5",
				["event"] = "Health",
				["subeventPrefix"] = "SPELL",
				["customDuration"] = "function()\n    if UnitDebuff(\"player\", aura_env.spellNameWrought) then\n        local duration = select(6, UnitDebuff(\"player\", aura_env.spellNameWrought))\n        local expTime = select(7, UnitDebuff(\"player\", aura_env.spellNameWrought))\n    elseif UnitDebuff(\"player\", aura_env.spellNameFocused) then\n        local duration = select(6, UnitDebuff(\"player\", aura_env.spellNameFocused))\n        local expTime = select(7, UnitDebuff(\"player\", aura_env.spellNameFocused))\n    else\n        return\n    end\n    \n    return duration, expTime\nend",
				["custom"] = "-- @Author: Nianah-Shattered-Hand, EU - taccr#2738\nfunction(event, timestamp, message, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, ...)  \n    if message == \"SPELL_CAST_START\" then\n        local spellId, spellName, spellSchool = ...\n        if spellName == aura_env.reset then\n            aura_env.playerListWrought = {}\n            aura_env.playerListFocused = {}\n            aura_env.ready = true\n            aura_env.order = nil\n        end\n    elseif message == \"SPELL_AURA_APPLIED\" then\n        local spellId, spellName, spellSchool = ...\n        \n        -- Spell not cast yet\n        if not aura_env.ready then\n            return false\n        elseif spellName == aura_env.spellNameWrought then\n            table.insert(aura_env.playerListWrought, destName)    \n        elseif spellName == aura_env.spellNameFocused then\n            table.insert(aura_env.playerListFocused, destName)                \n        end\n        \n        -- Spell is being cast, waiting for debuff apply\n        if #aura_env.playerListWrought == 0 then\n            return false\n            -- Spell cast and all debuffs in the raid\n        elseif #aura_env.playerListWrought == #aura_env.playerListFocused then\n            table.sort(aura_env.playerListWrought, aura_env.sort_func)\n            table.sort(aura_env.playerListFocused, aura_env.sort_func)\n            \n            -- Assign positions            \n            for i = 1, #aura_env.playerListWrought do\n                if UnitName(\"player\") == aura_env.playerListWrought[i] then \n                    aura_env.order = aura_env.positionsWrought[i]            \n                elseif UnitName(\"player\") == aura_env.playerListFocused[i] then \n                    aura_env.order = aura_env.positionsFocused[i]            \n                end\n            end\n            \n            -- Done for this cast\n            aura_env.ready = false\n            \n            -- Output if player afflicted\n            -- Should always be the case unless odd number alive\n            if aura_env.order then\n                SendChatMessage(aura_env.order .. \" - \" .. aura_env.message)\n                return true\n            end\n        end\n    end    \nend",
