				["custom"] = "\n\nfunction(event, ...)\n    \n    if event == \"ENCOUNTER_START\" then\n        local encounterID, encounterName, difficultyID, raidSize = ...\n        if encounterName == \"Blackhand\" then\n            WA_chrischange_phase = 1\n            WA_chrischange_marktext = \"\"\n            WA_chrischange_slagbombs = {}\n        end\n    end\n    \n    if event == \"CHAT_MSG_MONSTER_YELL\" then\n        local msg = ...\n        \n        if msg:find(\"Everyone DOWN\") or msg:find(\"no one will be able to put YOU back together\") then\n            WA_chrischange_phase = 2\n        end\n        \n        if msg:find(\"you will all BURN\") or msg:find(\"molten heart will devour you\") then\n            WA_chrischange_phase = 3 \n        end\n    end\n    \n    \n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local timeStamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellId, spellName, spellSchool, extraSpellID, extraSpellName, extraSchool = ...\n        \n        if subevent == \"SPELL_AURA_APPLIED\" and spellName == \"Attach Slag Bombs\" then --CHANGE DEBUFF NAME HERE\n            \n            table.insert(WA_chrischange_slagbombs, destName)    \n            \n            C_Timer.After(5, function() WA_chrischange_slagbombs = {} end)\n            \n            if #WA_chrischange_slagbombs == 2 then\n                table.sort(WA_chrischange_slagbombs)\n                local positions = {\"TOP\", \"BOTTOM\"}\n                for i = 1, #WA_chrischange_slagbombs do\n                    local position = table.remove(positions, 1)\n                    if UnitName(\"player\") == WA_chrischange_slagbombs[i] then \n                        SendChatMessage(position .. \" Slagbomb\")\n                        WA_chrischange_marktext = position\n                        return true\n                    end\n                end\n            end\n        end\n    end        \nend    \n\n\n\n",
