			["displayText"] = "%c",
			["customText"] = "-- @Author: Nianah-Shattered-Hand, EU - taccr#2738\nfunction()\n    if not UnitDebuff(\"player\", aura_env.spellName) then return 0 end\n    \n    local expTime = select(7, UnitDebuff(\"player\", aura_env.spellName))\n    local duration = expTime - GetTime()\n    \n    if math.ceil(duration) == 4 and aura_env.counter == 4 then\n        SendChatMessage(\"4\")\n        aura_env.counter = 3\n    elseif math.ceil(duration) == 3 and aura_env.counter == 3 then\n        SendChatMessage(\"3\")\n        aura_env.counter = 2\n    elseif math.ceil(duration) == 2 and aura_env.counter == 2 then\n        SendChatMessage(\"2\")\n        aura_env.counter = 1\n    elseif math.ceil(duration) == 1 and aura_env.counter == 1 then\n        SendChatMessage(\"1\")\n        aura_env.counter = 0\n    end\n    \n    return aura_env.order or 0\nend",
