				["custom"] = "-- @Author: Nianah-Shattered-Hand, EU - taccr#2738\nfunction(event, timestamp, message, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, ...)  \n    if message == \"SPELL_CAST_START\" then\n        local spellId, spellName, spellSchool = ...\n        if spellName == aura_env.reset then\n            aura_env.playerList = {}\n        end\n    elseif message == \"SPELL_AURA_APPLIED\" then\n        local spellId, spellName, spellSchool = ...\n        if spellName == aura_env.spellName then\n            table.insert(aura_env.playerList, destName)    \n            \n            -- Assign positions\n            if #aura_env.playerList == aura_env.numTargets then\n                table.sort(aura_env.playerList)\n                for i = 1, #aura_env.playerList do\n                    aura_env.order = aura_env.positions[i]            \n                    if UnitName(\"player\") == aura_env.playerList[i] then \n                        SendChatMessage(aura_env.order .. \" - \" .. aura_env.message)\n                        return true\n                    end\n                end\n            end\n        end\n    end    \nend",
