			["customText"] = "function()\n    if _G[\"player1_posx\"] and _G[\"player1_posy\"] then\n        posx, posy, posz, terrainmapid = UnitPosition(\"player\")\n        diffx1 = _G[\"player1_posx\"] - posx\n        diffy1 = _G[\"player1_posy\"] - posy\n        diffx2 = _G[\"player2_posx\"] - posx\n        diffy2 = _G[\"player2_posy\"] - posy\n        diffx3 = _G[\"player3_posx\"] - posx\n        diffy3 = _G[\"player3_posy\"] - posy\n        distance1 = math.floor(math.sqrt(math.pow(diffx1, 2) + math.pow(diffy1, 2)) + 0.5)\n        distance2 = math.floor(math.sqrt(math.pow(diffx2, 2) + math.pow(diffy2, 2)) + 0.5)\n        distance3 = math.floor(math.sqrt(math.pow(diffx3, 2) + math.pow(diffy3, 2)) + 0.5)\n        \n        \n        \n        if distance1 > 25 then color1 = \"|cff00ff00\"\n            \n        else color1 = \"|cffff0000\"\n        end\n        \n        if distance2 > 25 then color2 = \"|cff00ff00\"\n            \n        else color2 = \"|cffff0000\"\n        end\n        if distance3 > 25 then color3 = \"|cff00ff00\"\n            \n        else color3 = \"|cffff0000\"\n        end\n        \n        output = _G[\"WA_SHACKLED_TORMENTS\"][1]..\": \"..color1..distance1..\"\\n\".._G[\"WA_SHACKLED_TORMENTS\"][2]..\": \"..color2..distance2..\"\\n\".._G[\"WA_SHACKLED_TORMENTS\"][3]..\": \"..color3..distance3\n        \n        return  output\n        \n    end\n    \n    return \"-\"\nend\n\n\n\n\n",
