			["disjunctive"] = "all",
			["customText"] = "-- @Author: Nianah-Shattered-Hand, EU - taccr#2738\nfunction()\n    local ret = \"\"\n    local debuff = \"Digest\"\n    local expTime, duration, unitId, numPlayers, player_table\n    local debuff_table={}\n    \n    numPlayers = GetNumGroupMembers()\n    if numPlayers == 0 or not IsInRaid() then return nil end\n    \n    -- Duration coloring\n    local setDurationColor = function(duration)\n        if duration < 5 then\n            return \"|cFFFF0000\" .. math.floor(duration) .. \"|r\"         \n        elseif duration < 10 then\n            return \"|cFFFFFF00\" .. math.floor(duration) .. \"|r\"         \n        else\n            return \"|cFF00FF00\" .. math.floor(duration) .. \"|r\" \n        end\n    end\n    \n    -- Name coloring\n    local setClassColor = function(unitId) \n        _,class = UnitClass(unitId) \n        local color = RAID_CLASS_COLORS[class].colorStr\n        return  \"|c\" .. color .. UnitName(unitId) .. \"|r\"\n    end\n    \n    -- Custom sorting\n    local sort_func = function(a,b) return a[1] < b[1] end\n    \n    \n    -- Main\n    for i = 1, numPlayers do\n        unitId = \"raid\"..i\n        if UnitDebuff(unitId, debuff) then\n            expTime = select(7,UnitDebuff(unitId, debuff))\n            duration = expTime - GetTime()\n            table.insert(debuff_table, {duration, unitId})\n        end\n    end\n    \n    -- Generate return string\n    table.sort(debuff_table, sort_func)\n    while #debuff_table > 0 do\n        player_table = table.remove(debuff_table,1)\n        \n        ret = ret .. setClassColor(player_table[2]) .. \": \".. setDurationColor(player_table[1]) .. \"\\n\"\n    end\n    \n    return ret\nend",
