		["IR Artillery Range"] = {
			["outline"] = true,
			["fontSize"] = 20,
			["xOffset"] = 0,
			["displayText"] = "%c",
			["customText"] = "-- @Author: Nianah-Shattered-Hand, EU - taccr#2738\nfunction()\n    local ret = \"\"\n    local debuff = \"Artillery\"\n    local range, valid, unitId, numPlayers, duration, durationInfo\n    \n    numPlayers = GetNumGroupMembers()\n    if numPlayers == 0 or not IsInRaid() then return nil end\n    -- Do not display if player has debuff - handled by other WA\n    if UnitDebuff(\"player\", debuff) then return nil end\n    \n    -- Range coloring\n    local setRangeColor = function(range)\n        if range <= 40 then\n            return \"|cFFFF0000\" .. math.floor(range) .. \"|r\" \n        else\n            return \"|cFF00FF00\" .. math.floor(range) .. \"|r\" \n        end\n    end\n    \n    -- Name coloring\n    local setClassColor = function(unitId) \n        _,class = UnitClass(unitId) \n        local color = RAID_CLASS_COLORS[class].colorStr\n        return  \"|c\" .. color .. UnitName(unitId) .. \"|r\"\n    end\n    \n    \n    -- Main\n    for i = 1, numPlayers do\n        unitId = \"raid\"..i\n        if UnitDebuff(unitId, debuff) then\n            range, valid = UnitDistanceSquared(unitId)\n            if valid then\n                range = range ^ 0.5\n                range = range / 1.075\n            end\n            \n            -- Duration info\n            if not durationInfo then\n                duration = select(7,UnitDebuff(unitId, debuff)) - GetTime()\n                ret = ret .. math.floor(duration) .. \"\\n\"\n                durationInfo = true\n            end\n            \n            -- Return string\n            ret = ret .. setClassColor(unitId) .. \": \" .. setRangeColor(range) .. \"\\n\"\n        end\n    end\n    \n    return ret\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
